            Assam: data.data.regional[3],
            // Manipur: data.Manipur,
            // Meghalaya: data.Meghalaya,
            // Mizoram: data.Mizoram,
            // Nagaland: data.Nagaland,
            // Tripura: data.Tripura
        }
        // return re Assam: data[28],
        // return response
        // console.log(response)
        return modifiedData;

    } catch (error) {

    }
}
